INPUT_TEST = "2 3 0 3 10 11 12 1 1 0 1 99 2 1 1 2"


def compute_sum_metadata(input_: str) -> int:
    """Validates, processes the input, calls the traversal function and
    returns the sum of metadata

    Args:
        input_ (str): the input, as a string of space-separated integers

    Returns:
        int: the sum of all the metadata values contained in `input_`
    """
    assert isinstance(input_, str), "Input must be a string"
    data = map(int, input_.split())
    sum_metadata = 0

    def recurse():
        """Traverses the data structure provided and cumulatively sums the 
        metadata values, from left to right"""
        nonlocal sum_metadata
        child_nodes, metadata_entries = next(data), next(data)
        for _ in range(child_nodes):
            recurse()
        sum_metadata += sum(next(data) for _ in range(metadata_entries))

    recurse()
    return sum_metadata


assert compute_sum_metadata(INPUT_TEST) == 138
